-- ----------------------------
-- Function structure for `getRand`
-- ----------------------------
DROP FUNCTION IF EXISTS `getRand`;
DELIMITER ;;
CREATE FUNCTION `getRand`(counts INTEGER) RETURNS varchar(20) CHARSET utf8
BEGIN
    DECLARE sTemp VARCHAR(20);
    DECLARE sTempCounts INTEGER;
       SET sTemp =  ROUND(ROUND(RAND(),counts)*(POW(10,counts)));
      IF(CHAR_LENGTH(sTemp)<counts) THEN
      SET sTempCounts = counts - CHAR_LENGTH(sTemp);
      SET sTemp =CONCAT(sTemp,RIGHT(CONCAT(POW(10,sTempCounts),''),sTempCounts));
       END IF;
      IF (CHAR_LENGTH(sTemp)>counts) then
       SET sTemp = RIGHT(sTemp,counts);
    END IF;
    return sTemp;
END
;;
DELIMITER ;

-- ----------------------------
-- Function structure for `nextseq`
-- ----------------------------
DROP FUNCTION IF EXISTS `nextseq`;
DELIMITER ;;
CREATE FUNCTION `nextseq`(sequence_name varchar(64)) RETURNS int(11)
BEGIN
    declare current integer;
    set current = 0;
    
    select t.value into current from SYSTEM_SEQUENCE t where t.name = sequence_name for update;
    update SYSTEM_SEQUENCE t set t.value = t.value + 1 where t.name = sequence_name;
    set current = current + 1;

    return current;
end
;;
DELIMITER ;


